import { TopMenu } from "./TopMenu";
import { Logo } from "./Logo";

import './Header.css';

import logoHeader from '../img/Logo-header.svg';

export const Header = () => {
    return (
        <header className="header-setting">
            <TopMenu />
            <Logo logo={logoHeader} />
        </header>
    );
}
